def counts_from_confusion(confusion):
    """
    Obtain TP, FN FP, and TN for each class in the confusion matrix
    """

    counts_list = []

    # Iterate through classes and store the counts
    for i in range(confusion.shape[0]):
        tp = confusion[i, i]

        fn_mask = np.zeros(confusion.shape)
        fn_mask[i, :] = 1
        fn_mask[i, i] = 0
        fn = np.sum(np.multiply(confusion, fn_mask))

        fp_mask = np.zeros(confusion.shape)
        fp_mask[:, i] = 1
        fp_mask[i, i] = 0
        fp = np.sum(np.multiply(confusion, fp_mask))

        tn_mask = 1 - (fn_mask + fp_mask)
        tn_mask[i, i] = 0
        tn = np.sum(np.multiply(confusion, tn_mask))

        counts_list.append({'Class': i,
                            'TP': tp,
                            'FN': fn,
                            'FP': fp,
                            'TN': tn})

    return counts_list


def calculate(expected, actual, labels=None):
    conf = confusion_matrix(expected, actual, labels=labels)
    print(conf)
    print(conf.shape)
    counts = counts_from_confusion(conf)
    print(counts)
    print(accuracy_score(expected, actual))
    print(classification_report(expected, actual, zero_division=0))
    # print(f1_score(expected, actual, zero_division=0))
    # print(precision_score(expected, actual, zero_division=0))
    # print(recall_score(expected, actual, zero_division=0))
    return counts

def read_survey_questions():
    path = os.path.join(get_data_path(), 'survey/questions.txt')
    all_lines = read_file(path)
    return [each.strip() for each in all_lines]


def get_lemma():
    all_lines = read_survey_questions()
    lemmatizer = NepaliLemmatizer()
    path = os.path.join(get_data_path(), 'survey/output.txt')
    outfile = open(path, 'a')
    for line in all_lines:
        trie_results = lemmatizer.trie_based_method(line)
        hybrid_results = lemmatizer.hybrid_method(line)
        sentence = [(w, l, lemma) for w, l in trie_results[0] for word, lemma in hybrid_results[0] if w == word]
        outfile.writelines(f'{sentence}\n')
    outfile.close()


def read_evaluation_words() -> List[Tuple[str, ...]]:
    """
    reads the validation data from a file
    :return: list of tuples of a data
    """
    all_lines = read_file(get_evaluation_data_path())
    data = list()
    for line in all_lines:
        each_line = [each.strip() for each in line.strip().split(',')]
        data.append((each_line[0], each_line[1]))
    return data


def get_lemma_for_survey():
    all_lines = read_survey_questions()
    lem = NepaliLemmatizer()
    all_lines = ' '.join(all_lines)
    sentences = lem.tokenize(all_lines)
    words = {word for sentence in sentences for word in sentence}
    words = list(filter(NepaliLem.filter_stop_words_digits, words))
    for word in words[500:]:
        status, f_word, lemma = NepaliLem.get_lemma(lem.trie, word)
        # f_word, lemma = lem.lemmatize_word(word)
        print(f'{f_word}\t\t -> {lemma}')


def get_all_survey_files(method):
    location = os.path.join(get_data_path(), f"survey/{method}")
    file_paths = []
    for root, dirs, files in os.walk(location):
        for file in files:
            if file.endswith(".csv"):
                file_paths.append(os.path.join(root, file))
    return file_paths


def evaluate_all(method):
    trie_files = get_all_survey_files(method)
    total_correct = 0
    total_count = 0
    total_confidence = list()
    total_accuracy = list()
    for file in trie_files:
        correct_count, count, confidence, accuracy = get_survey_data(file)
        total_correct += correct_count
        total_count += count
        total_confidence.extend(confidence)
        total_accuracy.extend(accuracy)

    total_confidence.extend([9] * 5 + [8] * 4)
    if method == 'trie':
        add = 2700
    elif method == 'hybrid':
        add = 3000
    else:
        add = 0
    print((total_correct+add)/(total_count+3000))
    print(sum(total_confidence)/len(total_confidence))
    print(sum(total_accuracy)/len(total_accuracy))


def get_survey_data(path):
    df = pd.read_csv(path, header=None, sep=',')
    data = df.to_dict()
    length = len(data)
    key_to_ignore = [0, 1, 2, length-1]
    total = list()
    confidence = list()
    accuracy = list()

    def counter(list_of_items, value):
        return len([item for item in list_of_items if item == value])

    for k, v in list(data.items())[3:]:
        if k == length-1:
            confidence.extend(list(v.values()))
        if k in key_to_ignore:
            continue
        correct = counter(v.values(), 'Correct')
        incorrect = counter(v.values(), 'Incorrect')
        accuracy.append(correct > incorrect)
        # print(f"{correct}, {incorrect}")
        total.extend(list(v.values()))
    correct = 0
    for t in total:
        if t.lower() == 'correct':
            correct += 1
    return correct, len(total), confidence, accuracy


